<!DOCTYPE html>
<html lang="ja">
<head>
<meta charset="utf-8">
<meta name="viewport" content="width=device-width, initial-scale=1">
<title>MOB KART 10 - 完全版 v5.8.0</title>
<style>
  :root{ --panel:#1b1d24; --ink:#e9f0ff; --muted:#a6b0c2; --accent:#30d5c8; --danger:#ff4d67; --good:#27b35e; }
  *{box-sizing:border-box}
  html,body{height:100%;margin:0;font-family:"Inter","Yu Gothic",system-ui,-apple-system,Segoe UI,Roboto,sans-serif;background:radial-gradient(1200px 700px at 50% -10%,#1f2430,#0e0f12);color:var(--ink)}
  .wrap{max-width:1024px;margin:0 auto;padding:10px 10px 80px}
  header{display:flex;flex-direction:column;gap:8px;align-items:center}
  .board{position:relative;width:100%;max-height:300px;overflow:hidden;border-radius:12px;box-shadow:0 10px 30px rgba(0,0,0,.45)}
  .board img{width:100%;display:block;object-fit:cover;filter:contrast(1.05) saturate(1.05)}
  .wallet{position:absolute;right:14px;top:12px;display:flex;align-items:center;gap:10px;background:rgba(10,12,16,.6);backdrop-filter:blur(4px);border:1px solid rgba(255,255,255,.18);border-radius:14px;padding:8px 12px}
  .wallet img{height:34px;image-rendering:pixelated;filter:drop-shadow(0 4px 12px rgba(0,0,0,.5))}
  .wallet .amt{font-size:28px;font-weight:1000;letter-spacing:.5px;text-shadow:0 2px 10px rgba(0,0,0,.4)}
  @media(max-width:600px){ .wallet .amt{font-size:22px} .wallet img{height:28px} }

  #splash{position:fixed;inset:0;background:radial-gradient(1000px 500px at 50% 40%, rgba(0,0,0,.85), rgba(0,0,0,.95));display:flex;align-items:center;justify-content:center;z-index:200;pointer-events:auto}
  #splash img{width:min(90vw,980px);max-height:80vh;object-fit:contain;filter:drop-shadow(0 8px 28px rgba(0,0,0,.75));opacity:0;transform:scale(.96)}
  #splash.show img{animation:splashIn 1.5s ease-out forwards, splashOut 1.5s ease-in 1.5s forwards}
  @keyframes splashIn{from{opacity:0;transform:scale(.96)}to{opacity:1;transform:scale(1)}}
  @keyframes splashOut{0%{opacity:1;filter:brightness(1)}50%{opacity:.9;filter:brightness(1.9) blur(.5px)}100%{opacity:0;transform:scale(1.12);filter:brightness(2.2) blur(1px)}}

  .inter{position:fixed;inset:0;background:rgba(0,0,0,.88);display:none;align-items:center;justify-content:center;z-index:180}
  .inter img{max-width:96vw;max-height:88vh;object-fit:contain;filter:drop-shadow(0 10px 30px rgba(0,0,0,.7));opacity:0}
  .inter.show img{animation:fadeInOut 2s ease forwards}
  @keyframes fadeInOut{0%{opacity:0}15%{opacity:1}85%{opacity:1}100%{opacity:0}}

  .track{position:relative;margin-top:12px;border:1px solid #2f333b;border-radius:14px;padding:34px 6px 16px;box-shadow:inset 0 0 0 1px rgba(255,255,255,.04);overflow:hidden}
  .track.day{background:linear-gradient(#6c7077,#4b4f56)}
  .track.night{background:linear-gradient(#2c2f36,#1b1e25)}

  .lane{position:relative;height:54px;border-top:1px dashed rgba(255,255,255,.35);display:flex;align-items:center;overflow:hidden}
  .night .lane{border-top:1px dashed rgba(255,255,255,.55)}
  .lane:first-child{border-top:none}

  .flag{position:absolute;right:4px;top:50%;transform:translateY(-50%);width:10px;height:40px;background:linear-gradient(#888,#ddd);border-radius:3px}
  .finish{position:absolute;right:18px;top:41px;bottom:9px;width:12px;background:repeating-linear-gradient(90deg,#fff 0 5px,#222 5px 10px);box-shadow:0 0 0 1px rgba(255,255,255,.1)}
  .kart{position:absolute;left:8px;top:50%;transform:translateY(-50%);height:42px;image-rendering:pixelated;filter:drop-shadow(0 4px 8px rgba(0,0,0,.55));transition:transform .12s}
  .lane .label{position:relative;left:8px;top:-20px;font-size:11px;color:rgba(255,255,255,.75)}

  @keyframes shake{0%,100%{transform:translateY(-50%) translateX(0)}25%{transform:translateY(-50%) translateX(-1px)}75%{transform:translateY(-50%) translateX(1px)}}
  .slip{animation:shake .2s linear infinite;}

  .panel{margin-top:14px;background:var(--panel);border:1px solid #2c3140;border-radius:12px;padding:12px;display:grid;gap:10px}
  .odds-table{width:100%;border-collapse:collapse;font-size:13px;background:#161922;border-radius:8px;overflow:hidden;border:1px solid #2a2f3d}
  .odds-table th,.odds-table td{padding:6px 8px;border-bottom:1px solid #2a2f3d;text-align:center}
  .odds-table th{background:#1d2130;font-weight:600;color:#d5def3}
  .odds-table tr:last-child td{border-bottom:none}

  .bet-grid{display:grid;grid-template-columns:1fr;gap:10px}
  @media(min-width:900px){.bet-grid{grid-template-columns:1fr 1fr 1fr}}
  .card{background:#12151e;border:1px solid #2c3140;border-radius:10px;padding:10px;display:grid;gap:8px}
  .card h3{margin:0 0 4px 0;font-size:14px;color:#d4def6}
  label{font-size:12px;color:var(--muted)}
  select,input[type=number]{width:100%;background:#0f1220;border:1px solid #2c3140;color:#e9f0ff;border-radius:8px;padding:8px;font-size:14px}
  input[type=number]::-webkit-outer-spin-button,input[type=number]::-webkit-inner-spin-button{-webkit-appearance:none;margin:0;}
  .btn{padding:12px 18px;border-radius:12px;border:1px solid #2f3a52;background:#182032;color:#dfe9ff;font-weight:800;cursor:pointer}
  .btn.primary{background:linear-gradient(180deg,#2b65ff,#1842bf);border-color:#2050e0}
  .btn:disabled{opacity:.55;cursor:not-allowed}

  .intro{position:fixed;inset:0;background:rgba(10,12,16,.8);display:none;align-items:center;justify-content:center;z-index:30}
  .intro .box{width:min(520px,92vw);background:#0f1220;border:1px solid #32405c;border-radius:14px;box-shadow:0 20px 60px rgba(0,0,0,.6);overflow:hidden;position:relative}
  .intro .inner{position:relative;padding:16px 14px 18px;display:flex;gap:10px;align-items:center}
  .intro img{height:84px;image-rendering:pixelated;filter:drop-shadow(0 6px 16px rgba(0,0,0,.5))}
  .intro .lines{flex:1}
  .intro h2{margin:0 0 4px 0;font-size:16px}
  .intro p{margin:0;color:#bec7db;line-height:1.6}
  .slideIn{animation:slide .5s ease both}
  @keyframes slide{from{transform:translateX(-30px);opacity:0}to{transform:translateX(0);opacity:1}}
  .skip{background:#202a3f;color:#e6eeff;border:1px solid #3a4a6e;border-radius:12px;padding:10px 14px;font-size:12px;font-weight:800;cursor:pointer}
  .skip.floating{position:fixed;top:14px;right:14px;z-index:1001;display:none}

  .overlay{position:fixed;inset:0;background:rgba(0,0,0,.7);display:none;align-items:center;justify-content:center;z-index:25}
  .count{font-size:15vmin;font-weight:900;letter-spacing:.02em;text-shadow:0 0 30px rgba(255,255,255,.3)}

  .results{position:fixed;inset:0;background:rgba(0,0,0,.55);display:none;align-items:center;justify-content:center;z-index:40}
  .res-card{width:min(640px,94vw);max-height:86vh;background:#ffffff;color:#0d1220;border:1px solid #dfe3ee;border-radius:12px;overflow:auto;padding:16px 16px 24px;box-shadow:0 18px 60px rgba(0,0,0,.35)}
  .res-card h3{margin:0 0 8px;font-size:22px;text-align:center}
  .rank{display:grid;gap:8px;margin:10px 0}
  .rank .row{display:flex;align-items:center;gap:8px;background:#f4f6fb;border:1px solid #e0e5f2;border-radius:10px;padding:6px}
  .rank .row img{height:32px;image-rendering:pixelated}

  .win{color:#1a8f52;font-weight:800}
  .lose{color:#cc2f3b;font-weight:800}

  .payoutfx{position:fixed;inset:0;display:none;align-items:center;justify-content:center;z-index:45;pointer-events:none}
  .payoutfx .msg{font-size:8vmin;font-weight:1000;letter-spacing:.02em;padding:14px 20px;border-radius:14px;animation:popIn .5s ease forwards;background:rgba(255,255,255,.92);box-shadow:0 12px 40px rgba(0,0,0,.35)}
  .payoutfx .winmsg{color:#107a49;border:2px solid #8de0b3}
  .payoutfx .losemsg{color:#b3262d;border:2px solid #f2a0a6}
  @keyframes popIn{from{opacity:0;transform:scale(.9)}to{opacity:1;transform:scale(1)}}

  .confirm{position:fixed;inset:0;display:none;align-items:center;justify-content:center;z-index:50;background:rgba(0,0,0,.45)}
  .confirm .box{background:#0f1220;color:#e6eeff;border:1px solid #32405c;border-radius:14px;padding:18px 16px;min-width:min(380px,92vw);box-shadow:0 18px 60px rgba(0,0,0,.5);text-align:center}
  .confirm h4{margin:0 0 12px 0;font-size:18px}
  .confirm .btns{display:flex;gap:12px;justify-content:center}
</style>
</head>

      <button class="btn" id="btnNo">いいえ</button>
      <button class="btn primary" id="btnYes">はい</button>
    </div>
  </div>
</div>

<script>
const MAX_BET = 1000;
const racers = [{"id": 1, "name": "レインボー", "img": "src=""/"","""}];"B"
const phrases = {
  '超絶好調':['超絶好調','私には未来が視える','身体からパワーが溢れ出る','このレースは私そのものだ'],
  '絶好調':['負ける気がしません','私がNo.1です','今日という日に感謝'],
  '好調':['素晴らしい目覚めです','期待しててください','良いレースを見せます'],
  '普通':['ベストを尽くします','全力で挑みます','応援よろしくお願いします'],
  '不調':['さあ始めましょう','間に合った','気持ちが大事だ'],
  '絶不調':['今朝の牛乳か..？','神に祈る','こんな日もある'],
  '超絶不調':['・・・・・・。','お腹、空いた、、','絶望。それは突然訪れる']
};
const dist = {
  'SS':[0,1,4,45,20,20,10],
  'S':[1,3,6,52,18,16,4],
  'A':[2,5,10,55,16,10,2],
  'B':[3,7,15,55,12,7,1],
  'C':[4,10,18,54,9,4,1],
  'D':[6,14,22,50,6,2,0],
  'E':[10,20,30,35,4,1,0]
};
const condMap = ['超絶不調','絶不調','不調','普通','好調','絶好調','超絶好調'];
const condMult = {'超絶不調':0.78,'絶不調':0.85,'不調':0.93,'普通':1.00,'好調':1.07,'絶好調':1.15,'超絶好調':1.28};

let state = { wallet: 5000, staked: 0, todays:[], odds:[], probs:[], exactaCache:{}, trifectaCache:{}, env:'day', running:false,
eventTimers:new Array(racers.length).fill(0), activeEvent:new Array(racers.length).fill(null), eventCount:new Array(racers.length).fill(0),
eventCooldown:new Array(racers.length).fill(0), skipIntro:false, endgame:false, draftCD:new Array(racers.length).fill(0) };

const track=document.getElementById('track');
const oddsTable=document.getElementById('oddsTable');
const overlay=document.getElementById('overlay');
const count=document.getElementById('count');
const results=document.getElementById('results');
const rankList=document.getElementById('rankList');
const payoutDiv=document.getElementById('payout');
const payoutFx=document.getElementById('payoutFx');
const payoutFxMsg=document.getElementById('payoutFxMsg');
const nextConfirm=document.getElementById('nextConfirm');
const msg=document.getElementById('msg');
const walletAmt=document.getElementById('walletAmt');

const introModal=document.getElementById('intro');
const introImg=document.getElementById('introImg');
const introName=document.getElementById('introName');
const introLine=document.getElementById('introLine');
const skipIntroBtn=document.getElementById('skipIntroBtn');
const skipFloating=document.getElementById('skipFloating');

const preIntro=document.getElementById('preIntro');
const preStart=document.getElementById('preStart');

const controls = ['tansho1','tansho2','ren1','ren2','tri1','tri2','tri3','amt1','amt2','amtRen','amtTri','btnIntro','btnBet'].map(id=>document.getElementById(id));
function enableControls(flag){ controls.forEach(el=>{ el.disabled = !flag; }); }
function fmt(n){ return n.toLocaleString('ja-JP'); }
function updateWallet(){ walletAmt.textContent = fmt(state.wallet); }

function buildLanes(){
  track.querySelectorAll('.lane').forEach(el=>el.remove());
  racers.forEach((r,i)=>{
    const lane=document.createElement('div');
    lane.className='lane';
    lane.dataset.idx=i;
    lane.innerHTML = `<div class="label">No.${r.id} ${r.name}</div><img class="kart" id="kart-${i}" src="${r.img}" alt="kart">`;
    track.appendChild(lane);
  });
}

function randChoice(arr){return arr[Math.floor(Math.random()*arr.length)]}
function sampleCondition(stability){
  const w=dist[stability] || dist['S']; const total=w.reduce((a,b)=>a+b,0);
  let x=Math.random()*total, idx=0;
  while(x>=w[idx]){x-=w[idx++];}
  const cond=condMap[idx];
  return {cond, mult:condMult[cond], line:randChoice(phrases[cond])};
}

function computePowers(){
  const pow=racers.map((r,i)=>{
    const base= 0.42*(r.max_kmh/180) + 0.18*letter[r.tec] + 0.08*letter[r.jit] + 0.12*letter[r.men] + 0.14*letter[r.chase] + 0.06*(letter[r.stable]||letter['S']);
    return (base + Math.random()*0.02)*state.todays[i].mult;
  });
  const scale=3.3; const ex=pow.map(v=>Math.exp(v*scale)); const s=ex.reduce((a,b)=>a+b,0);
  state.probs=ex.map(v=>v/s);
  const margin=0.12;
  state.odds=state.probs.map(p=>Math.max(1.1,((1.0-margin)/p))).map(o=>Math.round(o*100)/100);
}

function computeExactaOdds(i,j){
  const key=`${i}-${j}`; if(state.exactaCache[key]) return state.exactaCache[key];
  const p1=state.probs[i], p2=state.probs[j];
  const prob=p1*(p2/Math.max(1e-6,(1-p1)))*0.95; const margin=0.20;
  const odds=Math.max(1.2,((1.0-margin)/Math.max(1e-6,prob)));
  return state.exactaCache[key]=Math.round(odds*100)/100;
}
function computeTrifectaOdds(i,j,k){
  const key=`${i}-${j}-${k}`; if(state.trifectaCache[key]) return state.trifectaCache[key];
  const p1=state.probs[i], p2=state.probs[j], p3=state.probs[k];
  const prob=p1*(p2/Math.max(1e-6,(1-p1)))*(p3/Math.max(1e-6,(1-p1-p2)))*0.90; const margin=0.30;
  const odds=Math.max(1.5,((1.0-margin)/Math.max(1e-6,prob)));
  return state.trifectaCache[key]=Math.round(odds*100)/100;
}

function renderOdds(){
  oddsTable.innerHTML = `<tr><th>No.</th><th>キャラクター</th><th>単勝オッズ</th></tr>`+
  state.odds.map((o,i)=>`<tr><td>${racers[i].id}</td><td style="text-align:left;display:flex;gap:6px;align-items:center"><img src="${racers[i].img}" style="height:20px;image-rendering:pixelated"> ${racers[i].name}</td><td>${o.toFixed(2)} 倍</td></tr>`).join('');
}

function fillSelects(){
  const opts=racers.map((r,i)=>`<option value="${i}">No.${r.id} ${r.name}</option>`).join('');
  ['tansho1','tansho2','ren1','ren2','tri1','tri2','tri3'].forEach(id=>{
    const el=document.getElementById(id); if(el) el.innerHTML=`<option value="">--</option>`+opts;
  });
}
function updateRenOdds(){ const i=document.getElementById('ren1').value, j=document.getElementById('ren2').value; document.getElementById('renOdds').textContent=(i!==''&&j!==''&&i!==j)?(computeExactaOdds(+i,+j).toFixed(2)+' 倍'):'--'; }
function updateTriOdds(){ const a=doc('tri1'), b=doc('tri2'), c=doc('tri3'); document.getElementById('triOdds').textContent=(a!==''&&b!==''&&c!==''&&a!==b&&a!==c&&b!==c)?(computeTrifectaOdds(+a,+b,+c).toFixed(2)+' 倍'):'--'; }
function doc(id){return document.getElementById(id).value;}
['ren1','ren2'].forEach(id=>document.getElementById(id).addEventListener('change', updateRenOdds));
['tri1','tri2','tri3'].forEach(id=>document.getElementById(id).addEventListener('change', updateTriOdds));

function chooseEnvironment(){ return (Math.random()<0.35)?'night':'day'; }
function applyEnvironment(env){
  const el=document.getElementById('track');
  el.classList.remove('day','night'); el.classList.add(env); state.env=env;
}

async function showInter(el, ms=2000){ el.style.display='flex'; el.classList.add('show'); await new Promise(r=>setTimeout(r,ms)); el.style.display='none'; el.classList.remove('show'); }

async function doIntro(){
  state.skipIntro=false;
  state.endgame=false;
  await showInter(preIntro, 2000);
  skipFloating.style.display='block';
  state.todays=racers.map(r=>sampleCondition(r.stable));
  state.exactaCache={}; state.trifectaCache={};
  computePowers(); renderOdds(); fillSelects(); updateRenOdds(); updateTriOdds();
  for(let i=0;i<racers.length;i++){
    if(state.skipIntro) break;
    introImg.src=racers[i].img; introName.textContent=`No.${racers[i].id} ${racers[i].name}`;
    introLine.textContent=state.todays[i].line;
    introModal.style.display='flex'; await new Promise(res=>setTimeout(res,1100));
    if(state.skipIntro) break;
    introModal.style.display='none'; await new Promise(res=>setTimeout(res,120));
  }
  introModal.style.display='none';
  skipFloating.style.display='none';
}

function validateBet(v,max=MAX_BET){ if(v===''||isNaN(v)) return 0; return Math.max(0,Math.min(max,Math.floor(Number(v)))); }
function softClampBet(id){ const el=document.getElementById(id); el.value=validateBet(el.value); }
['amt1','amt2','amtRen','amtTri'].forEach(id=>{
  document.getElementById(id).addEventListener('change', ()=>softClampBet(id));
  document.getElementById(id).addEventListener('input', ()=>softClampBet(id));
});

async function startRace(){
  if(state.running) return; state.running=true; msg.textContent='';
  applyEnvironment(chooseEnvironment());
  const splash = document.getElementById('splash'); if(splash) splash.style.display='none';

  await showInter(preStart, 2000);

  overlay.style.display='flex'; count.textContent='3'; document.getElementById('track').scrollIntoView({behavior:'smooth', block:'center'});
  await new Promise(r=>setTimeout(r,700)); count.textContent='2'; await new Promise(r=>setTimeout(r,700));
  count.textContent='1'; await new Promise(r=>setTimeout(r,700)); count.textContent='GO'; await new Promise(r=>setTimeout(r,600));
  overlay.style.display='none';

  const trackWidth=track.clientWidth, finishX=trackWidth-46, distance=Math.max(10,finishX-20);
  const relP=state.probs.map(p=>1/p); const avg=relP.reduce((a,b)=>a+b,0)/relP.length; const target=15+Math.random()*10;
  let speeds=relP.map(v=>distance/(target*(v/avg)));
  const boosts=racers.map((r,i)=>1+(letter[r.chase]-0.8)*0.30);
  const technique=racers.map(r=>1+(letter[r.tec]-0.8)*0.18);
  const mental=racers.map(r=>1+(letter[r.men]-0.8)*0.12);
  const exp=racers.map(r=>1+(letter[r.jit]-0.8)*0.06);
  const today=state.todays.map(t=>t.mult);
  let baseSpd=speeds.map((s,i)=> s*boosts[i]*technique[i]*mental[i]*exp[i]*today[i]);
  if(state.env==='night'){ baseSpd=baseSpd.map((v,i)=> v*(1+(letter[racers[i].tec]-0.8)*0.05)); }

  const start=performance.now(); const positions=new Array(racers.length).fill(8), finished=[], finishTimes=new Array(racers.length).fill(null);

  state.eventTimers=new Array(racers.length).fill(0);
  state.activeEvent=new Array(racers.length).fill(null);
  state.eventCount=new Array(racers.length).fill(0);
  state.eventCooldown=new Array(racers.length).fill(0);
  state.draftCD=new Array(racers.length).fill(0);
  state.endgame=false;

  function step(now){
    const t=(now-start)/1000;

    let maxProgress = 0;
    let leaderX = 0;
    for(let i=0;i<racers.length;i++){ leaderX = Math.max(leaderX, positions[i]); }

    for(let i=0;i<racers.length;i++){
      if(finishTimes[i]!=null) continue;
      let v=baseSpd[i];

      const progress = positions[i] / distance;
      if(progress>maxProgress) maxProgress = progress;

      if(progress < 0.35){
        const frontFavor = Math.max(0, (0.35 - progress)) * (0.8 - letter[racers[i].chase]) * 0.18;
        v *= (1 + frontFavor);
      }

      const gap = Math.max(0, leaderX - positions[i]);
      const trail = gap / distance;
      if(trail > 0){
        const catchCoef = 1 + Math.min(trail, 0.8) * (0.20 + 0.30 * letter[racers[i].chase]);
        v *= catchCoef;
      }

      if(state.draftCD[i]>0) state.draftCD[i]--;
      if(state.draftCD[i]===0){
        for(let j=0;j<racers.length;j++){
          if(i===j) continue;
          const dx = positions[j] - positions[i];
          if(dx>40 && dx<60){
            const draftBoost = 1.05 + 0.05 * letter[racers[i].chase];
            v *= draftBoost;
            state.draftCD[i] = 45;
            break;
          }
        }
      }

      if(state.endgame){
        const globalBoost = 1.12;
        const chaseCoef = 1 + (letter[racers[i].chase] - 0.5) * 0.9;
        const phase = Math.max(0, (progress - 0.5) / 0.5);
        const ramp = 1 + phase * 0.9;
        v *= globalBoost * chaseCoef * ramp;
      }

      if(state.eventCooldown[i]>0) state.eventCooldown[i]--;
      if(state.eventTimers[i]>0){
        state.eventTimers[i]--;
        if(state.activeEvent[i]==='slip') v*=0.86;
        if(state.eventTimers[i]===0){
          const img=document.getElementById(`kart-${i}`);
          img.classList.remove('slip'); state.activeEvent[i]=null; state.eventCooldown[i]=90;
        }
      }else{
        if(state.eventCount[i]<2 && state.eventCooldown[i]===0){
          const baseProb = 0.0014;
          const reduce = (letter[racers[i].tec]-0.8)*0.7 + (letter[racers[i].jit]-0.8)*0.4;
          const p = Math.max(0.0004, baseProb*(1 - reduce));
          if(Math.random()<p){
            state.activeEvent[i]='slip';
            state.eventTimers[i]=60+Math.floor(Math.random()*30); state.eventCount[i]++;
            document.getElementById(`kart-${i}`).classList.add('slip');
          }
        }
      }

      v *= (0.985 + Math.random()*0.03);
      positions[i]+=v*(1/60);
      const img=document.getElementById(`kart-${i}`);
      const finishX=track.clientWidth-46;
      img.style.left=Math.min(8+positions[i], finishX)+'px';
      if(8+positions[i] >= finishX && finishTimes[i]==null){
        finishTimes[i]=t; finished.push(i); img.classList.remove('slip');
        if(finished.length===racers.length) endRace(finishTimes);
      }
    }

    if(!state.endgame && maxProgress > 0.5){ state.endgame = true; }
    if(finished.length<racers.length) requestAnimationFrame(step);
  }
  requestAnimationFrame(step);
}

function clearAllFx(){ for(let i=0;i<racers.length;i++){ const img=document.getElementById(`kart-${i}`); if(img) img.classList.remove('slip'); } }
function showPayoutFx(text, win){
  payoutFxMsg.className = 'msg ' + (win?'winmsg':'losemsg');
  payoutFxMsg.textContent = text;
  payoutFx.style.display='flex';
  setTimeout(()=>{ payoutFx.style.display='none'; }, 2200);
}

function endRace(times){
  state.running=false;
  const order = times.map((t,i)=>({i,t})).sort((a,b)=>a.t-b.t).map(o=>o.i);
  rankList.innerHTML = order.map((idx,rank)=>`<div class='row'><div style='width:26px;text-align:right;font-weight:800'>${rank+1}</div><img src='${racers[idx].img}'><div style='flex:1'>${racers[idx].name}</div><div style='opacity:.7;font-size:12px'>${times[idx].toFixed(2)}s</div></div>`).join('');
  let totalWin=0;
  for(let k=1;k<=2;k++){ const sel=document.getElementById('tansho'+k).value, amt=validateBet(document.getElementById('amt'+k).value);
    if(sel!=='' && amt>0 && order[0]===+sel) totalWin += Math.floor(amt * state.odds[+sel]); }
  const r1=document.getElementById('ren1').value, r2=document.getElementById('ren2').value, aR=validateBet(document.getElementById('amtRen').value);
  if(r1!==''&&r2!==''&&aR>0&&r1!==r2 && order[0]===+r1 && order[1]===+r2) totalWin += Math.floor(aR*computeExactaOdds(+r1,+r2));
  const t1=document.getElementById('tri1').value, t2=document.getElementById('tri2').value, t3=document.getElementById('tri3').value, aT=validateBet(document.getElementById('amtTri').value);
  if(t1!==''&&t2!==''&&t3!==''&&aT>0 && (t1!==t2&&t1!==t3&&t2!==t3) && order[0]===+t1 && order[1]===+t2 && order[2]===+t3) totalWin += Math.floor(aT*computeTrifectaOdds(+t1,+t2,+t3));

  if(totalWin>0){
    state.wallet += totalWin;
    showPayoutFx(`的中！ +${totalWin.toLocaleString('ja-JP')} コイン`, true);
  }else{
    showPayoutFx('残念！ハズレ！', false);
  }
  updateWallet();

  payoutDiv.innerHTML = totalWin>0 ? `<span class="win">的中！${totalWin} コイン手に入れた！</span>` : `<span class="lose">残念！ハズレ！</span>`;

  results.style.display='flex';
  setTimeout(()=>{ nextConfirm.style.display='flex'; }, 3000);
  clearAllFx();
}

function resetPositions(){ for(let i=0;i<racers.length;i++){ const img=document.getElementById(`kart-${i}`); if(img){ img.style.left='8px'; img.classList.remove('slip'); } } }

function init(){
  buildLanes();
  updateWallet();
  const splash=document.getElementById('splash');
  document.querySelector('#splash').classList.add('show');
  setTimeout(()=>{ 
    splash.style.display='none'; 
    enableControls(true); 
    doIntro();
  }, 3000);
}
init();

function skipAllIntro(){ state.skipIntro=true; introModal.style.display='none'; skipFloating.style.display='none'; }
skipIntroBtn.addEventListener('click', skipAllIntro);
skipFloating.addEventListener('click', skipAllIntro);

document.getElementById('btnIntro').addEventListener('click', async()=>{ if(state.running) return; await doIntro(); resetPositions(); });
document.getElementById('btnBet').addEventListener('click', ()=>{
  if(state.running) return;
  const a1=validateBet(document.getElementById('amt1').value), a2=validateBet(document.getElementById('amt2').value), ar=validateBet(document.getElementById('amtRen').value), at=validateBet(document.getElementById('amtTri').value);
  const s1=document.getElementById('tansho1').value, s2=document.getElementById('tansho2').value, r1=document.getElementById('ren1').value, r2=document.getElementById('ren2').value, t1=document.getElementById('tri1').value, t2=document.getElementById('tri2').value, t3=document.getElementById('tri3').value;
  if(a1>MAX_BET||a2>MAX_BET||ar>MAX_BET||at>MAX_BET){ msg.textContent='各ベットは最大1000コインまでです。'; return; }
  if(a1>0&&s1===''){ msg.textContent='単勝その1のキャラクターを選んでください。'; return; }
  if(a2>0&&s2===''){ msg.textContent='単勝その2のキャラクターを選んでください。'; return; }
  if(a1>0&&a2>0&&s1!==''&&s2!==''&&s1===s2){ msg.textContent='単勝は同一キャラクターを重複選択できません。'; return; }
  if(ar>0&&(r1===''||r2==='')){ msg.textContent='連MOBは1位と2位を選んでください。'; return; }
  if(r1!==''&&r2!==''&&r1===r2&&ar>0){ msg.textContent='連MOBは同一キャラクターを選べません。'; return; }
  if(at>0){ if(t1===''||t2===''||t3===''){ msg.textContent='3連MOBは1〜3位をすべて選んでください。'; return; } if(!(t1!==t2&&t1!==t3&&t2!==t3)){ msg.textContent='3連MOBは同一キャラクターを重複選択できません。'; return; } }
  const stake = a1 + a2 + ar + at;
  if(stake > state.wallet){ msg.textContent=`所持コインが足りません。（必要: ${stake.toLocaleString('ja-JP')} / 所持: ${state.wallet.toLocaleString('ja-JP')}）`; return; }
  state.wallet -= stake; state.staked = stake; updateWallet(); msg.textContent = stake>0 ? `ベット合計 ${stake} コイン。健闘を祈る！` : 'ベットなしでスタート！';
  startRace();
});
document.getElementById('btnYes').addEventListener('click', ()=>{ nextConfirm.style.display='none'; results.style.display='none'; resetPositions(); doIntro(); });
document.getElementById('btnNo').addEventListener('click', ()=>{ nextConfirm.style.display='none'; results.style.display='none'; });
</script>
</body>
</html>
